import { motion } from "framer-motion"

const Home = () => {
  return (
    <motion.div
      className="AK-SE"
      initial={{ opactity: 0 }}
      animate={{ opactiy: 1, height: 1, transition: { duration: 1 } }}
      exit={{ opacity: 0, height: 0, transition: { duration: 0.6 } }}
    >
      <motion.div
        className="headings"
        initial={{ opactity: 0, transition: { duration: 1 } }}
        animate={{
          opactiy: 1,
          scale: [0, 1.3, 1.3, 1.3, 1],
          rotate: [0, 360, 360, 0],
          transition: { duration: 3 },
        }}
        exit={{
          scale: [1, 1, 0.5, 0],
          rotate: [0, 360],
          transition: { duration: 0.6 },
        }}
      >
        <div className="name">
          <h2>ANDREW KEIR</h2>
        </div>

        <div className="name-blur">
          <h2>ANDREW KEIR</h2>
        </div>

        <div className="title">
          <h2>Software Engineer</h2>
        </div>

        <div className="title-blur">
          <h2>Software Engineer</h2>
        </div>
      </motion.div>
      <img src="" alt="" />
    </motion.div>
  )
}

export default Home
